    padding: 10px;
`;

const PostForm = () => {
    const onSubmit = () => {};

    return (
        <FormWrapper onFinish={onSubmit}>
            <Input.TextArea></Input.TextArea>
        </FormWrapper>
    );
};

export default PostForm;
